//Global variables asignations
var Start_Stop  = flow.get("Run");
var Direction   = flow.get("Direction");
var Reset       = flow.get("Reset")
var Command     = 0;

// Start/Stop
if(Start_Stop === true){buffer[0] = 0;  buffer[1] = 1;  msg.command = "Start"; }
else{                   buffer[0] = 1;  buffer[1] = 0;  msg.command = "Stop" }

//Reset
if(Reset === true){     buffer[3] = 1; msg.command = "Reset"; }
else{                   buffer[3] = 0;}

// Direction
if(Direction === true){buffer[4] = 0;   buffer[5] = 1;  msg.direction = "Reverse"; }
else{                  buffer[4] = 1;   buffer[5] = 0;  msg.direction =" Forward" }

//Command construction
for(var i=0; i<buffer.length; i++){
    Command += buffer[i] * Math.pow(2, i);
}
msg.payload = Command;
msg.buffer = buffer;

return msg

