// Setpoints
var HHSetpoint  = flow.get("HHSetpoint")||0;
var HSetpoint   = flow.get("HSetpoint")||0;
var LSetpoint   = flow.get("LSetpoint")||0;
var LLSetpoint  = flow.get("LLSetpoint")||0;

// Enablers
var HH_EN       = flow.get("HHEN")||false;
var H_EN        = flow.get("HEN")||false;
var L_EN        = flow.get("LEN")||false;
var LL_EN       = flow.get("LLEN")||false;

// Death times
var HHDeathTime = flow.get("HHDT")||0;
var HDeathTime  = flow.get("HDT")||0;
var LDeathTime  = flow.get("LDT")||0;
var LLDeathTime = flow.get("LLDT")||0;

// Value
var CurrentValue = msg.payload;

if(CurrentValue >= HHSetpoint && HH_EN === true){
    msg.disp = true;
    msg.alrm = false;
    msg.message = "Trigger by HH Protection";
    msg.delay = HHDeathTime * 1000;
    msg.state = 4;
}
else if(CurrentValue >= HSetpoint && H_EN === true){
    msg.disp = false;
    msg.alrm = true;
    msg.message = "Alarm by H Protection";
    msg.delay = HDeathTime * 1000;
    msg.state = 2;
}
else if(CurrentValue <= LLSetpoint && LL_EN === true){
    msg.disp = true;
    msg.alrm = false;
    msg.message = "Trigger by LL Protection"
    msg.delay = LLDeathTime * 1000;
    msg.state = 3;
}
else if(CurrentValue <= LSetpoint && L_EN === true){
    msg.disp = false;
    msg.alrm = true;
    msg.message = "Alarm by L Protection";
    msg.delay = LDeathTime * 1000;
    msg.state = 1;
}
else{
    msg.disp = false;
    msg.alrm = false;
    msg.message = "Normal condition";
    msg.reset = true;
    msg.state= 0;
}
return msg;

