var FechaFinal = context.get("FinalDate") || "";

// Definiciones
var TakeSample = false;
var CurrentDate = new Date();

if (enable1 === true){
    if (Bandera === false ){
        var DateString = CurrentDate.toString();
        FechaFinal = new Date(DateString);
        FechaFinal.setSeconds( FechaFinal.getSeconds() + Rate);
        context.set("FinalDate",FechaFinal);
        Bandera = true;   
        TakeSample = false;
    }
    else {
        if (CurrentDate >= FechaFinal){
            TakeSample = true;
            Bandera = false;
        }
    }
    msg.payload = {
        'Current'   : CurrentDate,
        'Final'     : FechaFinal,
        'TakeSample': TakeSample
    }
